import { Component } from 'react';
import Auth from '../components/Auth/Auth';
import Dashboard from '../components/Dashboard/Dashboard';

class App extends Component{
    constructor(props){
        super(props)

        this.state = {
            user : false
        }
    }

    render(){
        return (
            <div>
                {(!this.state.user) ? <Dashboard/> : <Auth/>}
            </div>
        );
    }
}

export default App;
